import React, { useContext } from "react";
import { UserContext } from "../../hooks/UserHooks/userContextApp";

const FavoritCards = () => {
  const { likedCards } = useContext(UserContext);

  return (
    <div className="bodyAbout">
      <h1>Favorit Cards</h1>
      <div>
        <ul>
          {likedCards.map((card) => (
            <li key={card._id}> {/* הוסף את ה-key כאן */}
              <img
                src={card.image.url}
                alt={card.image.alt}
                style={{ width: "100px", height: "100px" }}
              />
              <h2>{card.title}</h2>
              <p>{card.subtitle}</p>
              <p>{card.address.country}</p>
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default FavoritCards;
